import React, { Component } from 'react';
import { Grid,Row,Col} from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import '../App.css';
class FooterBar extends Component {
  render() {
    return (
        <Grid className='footer-layout'>

                <Col xs={12} >
                    Footer
                </Col>
                    </Grid>
    );
  }
}

export default FooterBar;
